    String vastus;
    String info = "Sisesta otsisõna";
    URL baas;
    final int laius = 120;
    final int korgus = 0;
    public int linkideArv;
    private int otsitudLaius = 0;
    private Color otsitudVarv = new Color(255,213,151);
    private Font tekstiFont = new Font("Arial", Font.BOLD, 12);
    private int tekstiAlgus = 11;

    public void init() {
                        baas = getCodeBase();
                        start();
    }

    public void start() {
    }

    public void paint( java.awt.Graphics gc ) {
                gc.setColor(Color.white);
                gc.fillRect(0,korgus,laius,20);
                gc.setColor(otsitudVarv);
                gc.fillRect(0,korgus,otsitudLaius,20);
                gc.setColor(Color.black);
                gc.setFont(tekstiFont);
                gc.draw3DRect(0,0,laius,korgus,false);
                gc.drawString(info, tekstiAlgus, korgus+14);
    }

    public String OtsiStringi( String otsisona ) {
                int i;
                String failiNimi, pealKiri;
                int trelliKoht;
                int protsent;

                vastus = "";
                linkideArv = 0;
                otsitudLaius = 0;
                otsisona = otsisona.toUpperCase();

                for (i = 0; i < failinimed.length; i++) {
                    trelliKoht = failinimed[i].indexOf("#");
                    failiNimi = failinimed[i].substring(trelliKoht+1);
                    pealKiri = failinimed[i].substring(0,trelliKoht);
                    otsitudLaius = ( laius * i ) / failinimed.length;
                    protsent = ( 100 * i ) / failinimed.length;
                    info = "" + protsent + "%";
                    tekstiAlgus = 52;
                    repaint(0,korgus,laius,20);
                    if (SisaldubFailis( failiNimi, otsisona ) ) {
                            ++linkideArv;
                            vastus = vastus + "|" + failiNimi;
                            vastus = vastus + "|" + pealKiri;
                    }
                }
                info = "Sisesta otsisõna";
                tekstiAlgus = 11;
                otsitudLaius = 0;
                repaint (0,korgus,laius,20);
                vastus = vastus + "|";
                return vastus;
    }

    private boolean SisaldubFailis( String fail, String otsisona) {

                URL url;
                String rida;
                BufferedReader puhver;

                try { url = new URL(baas, fail); }
                catch (MalformedURLException e) {
                        info = "Sain vale URL-i";
                        repaint(0,korgus,laius,20);
                        return false;
                }
                try { puhver=new BufferedReader(new InputStreamReader(url.openStream())); }
                catch (IOException e) {
                        info = "Viga faili" + fail + " avamisel";
                        repaint(0,korgus,laius,20);
                        return false;
                }
                try { rida = puhver.readLine(); }
                catch (IOException e)
                {
                        info = "Ei suutnud lugeda rida failist" + fail;
                        repaint(0,korgus,laius,20);
                        return false;
                }
                while ( rida != null ) {
                        rida = rida.toUpperCase();
                        if ( rida.indexOf(otsisona) >= 0 )
                                return true;
                        try { rida = puhver.readLine();
                        }
                        catch (IOException e)
                        {
                                info = "Ei suutnud lugeda rida failist" + fail;
                                repaint(0,korgus,laius,20);
                                return false;
                        }
                }
                return false;
    }

